import React from 'react';
import './Header.css';
import logo from '../../icono.png'; // Tell webpack this JS file uses this image


function Header(props) {
    return (
      <div>
        <ul>
        <li><a href="#home">Home</a></li>
        <li style="float:right">
        <img  style={{float : 'left', paddingRight : '5px'}} src={logo} alt="Logo" />
        </li> 
      </ul>
      </div>
    );
  }
  
export default Header;
